import { inject, provide, ref } from 'vue';
var contextKey = Symbol('floatButtonGroupContext');
export var useProvideFloatButtonGroupContext = function useProvideFloatButtonGroupContext(props) {
  provide(contextKey, props);
  return props;
};
export var useInjectFloatButtonGroupContext = function useInjectFloatButtonGroupContext() {
  return inject(contextKey, {
    shape: ref()
  });
};
